import "./App.css";
import Hello from "./component/Hello";
import Botao from "./component/Botao";
import TodoList from "./component/TodoList";
import { Router } from "react-router-dom";
function App() {

  return (
    <Router>
      <Hello />
      <Botao/>
      <TodoList/>
    </Router>
  );
}

export default App;
